import React, { Component } from "react";
import axios from "axios";

export class App extends Component {
  constructor() {
    super();
    this.state = {
      persons: []
    };
  }

  componentDidMount() {
    axios.get(`https://jsonplaceholder.typicode.com/comments`).then(res => {
      const persons = res.data;
      console.log(persons);
      this.setState({ persons });
    });
  }
  renderTable() {
    return this.state.persons.map(person => {
      return (
        <tbody key={person.id}>
          <td>{}</td>
          <td>{person.name}</td>
          <td>{}Eur </td>
          <td></td>
        </tbody>
      );
    });
  }
  render() {
    console.log(this.state.persons.name);
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Data</th>
              <th>Islaidos uz</th>
              <th>Kaina</th>
              <th>Redaguoti</th>
            </tr>
          </thead>
          {this.renderTable()}
        </table>
        <ul>
          {this.state.persons.map(person => (
            <li>{person.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default App;
